import classes from './Home.module.css'


const Home = () => {
    return ( 
        <div className={classes.Home} id="home">
            <div className={classes.Container}>
                <h1 className={classes.Hello}>Introduce me !</h1>
                <br></br>
                <h1>I'm seungeun,Park</h1>
            </div>

        </div>
     );
}

export default Home;
